","keccak256":"0x1c4860acd323e34a67b3e97faab9aaa55fe8e92b1dcf08b5f47f3468d58ce75c","license":"MIT"},"contracts/XperiendNFT.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity >=0.8.7;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721BurnableUpgradeable.sol";
import "hardhat/console.sol";


/**
 * @title non fungible tokens
 * ERC721Upgradeable agregarle accessControl y changeAllow 
 */
contract XperiendNFT is Initializable, ERC721BurnableUpgradeable {
	uint public id; 
    struct tokenData {
    address creator;
    string ipfsHash;
    uint projectId;
    string documentId;
    }

    struct Exchanges {
    address giver;
    address receiver;
    uint projectId;
    uint nftId;
    uint created;
    uint finished;
    Status status;
    }

    struct Claims {
    address claimer;
    uint nftId;
    uint created;
    uint finished;
    Status status;
    }
    struct Reinvest {
    address reinvester;
    uint nftId;
    uint created;
    uint finished;
    Status status;
    }
    /// id--> data
    mapping (uint=>tokenData) nfts;

    /// nftId-> exchange
    mapping(uint=>Exchanges) public exchangeByNFT;

    /// address--> exchanges
    mapping(address=>uint[]) public exchangesByAddress;
        /// project--> exchanges
    mapping(uint=>uint[]) public exchangesByProject;
 /// nftId-> exchange
    mapping(uint=>Claims) public claimsByNFT;

    /// address--> exchanges
    mapping(address=>uint[]) public claimsByAddress;

     /// nftId-> exchange
    mapping(uint=>Reinvest) public reinvestByNFT;

    /// address--> exchanges
    mapping(address=>uint[]) public reinvestByAddress;

        ///token id-> hashImage
    enum Status {
        COMPLETED,
        INPROCESS,
        CANCELED
    }



    event NewNFT(address creator, uint id,string ipfsHash);

    function initialize() public initializer {
      _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
      __ERC721_init("XREN_NFT", "SNY");
        _setupRole(RECEIVER_ROLE,address(this));
    }

    function changeAllow() public onlyOwner returns (bool) {
        if(allow) {
            allow= false;
        } else {
            allow=true;
        }
        return allow;
    }

    //  MODIFIERS
    modifier onlyOwner(){
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Only owner can access");
        _;
    }
     function onERC721Received(address, address, uint256, bytes calldata) external pure returns (bytes4) {
        return IERC721ReceiverUpgradeable.onERC721Received.selector;
    }



    function safeMint(address _to,string memory _tokenHash,string memory documentId,uint projectId) public onlyOwner {
        id++;
        tokenData memory p = tokenData(_to,_tokenHash,projectId,documentId);
        nfts[id]=p;
        _safeMint(_to, id);
        emit NewNFT(_to, id, _tokenHash);
    }
     function updateIpfsHash(uint256 _tokenId,string memory _ipfsHash) public {
        nfts[_tokenId].ipfsHash=_ipfsHash;
    }
    function getTokenData(uint256 tokenId) public view returns (tokenData memory){
        return nfts[tokenId];
    }
        function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) public virtual override {
        require(hasRole(RECEIVER_ROLE,to) || allow,"ERC721: This account is not a receiver");
        require(_isApprovedOrOwner(msg.sender, tokenId), "ERC721: transfer caller is not owner nor approved");
        _safeTransfer(from, to, tokenId, _data);
    }

    function exchangeNFT(uint projectId,uint nftId) public returns (bool) {
        require(ownerOf(nftId)==msg.sender,"Not  nft owner");
        require(exchangeByNFT[nftId].status!=Status.CANCELED,"This exchange was created before and canceled");
        safeTransferFrom(msg.sender, address(this), nftId, "0x");

        Exchanges memory p= Exchanges(msg.sender,address(this),projectId,nftId,block.timestamp,block.timestamp,Status.INPROCESS);
        exchangeByNFT[nftId]=p;
        exchangesByAddress[msg.sender].push(nftId);
        exchangesByProject[projectId].push(nftId);
        return true;
    }
     function getExchangeByProject(uint projectId) public view returns (uint[] memory) {
        return exchangesByProject[projectId];
    }
       function getExchangeByUser(address _user) public view returns (uint[] memory) {
        return exchangesByAddress[_user];
    }


           function getExchange(uint nftId) public view returns (Exchanges memory) {
        return exchangeByNFT[nftId];
    }
           function getClaim(uint nftId) public view returns (Claims memory) {
        return claimsByNFT[nftId];
    }

       function getClaimByUser(address _user) public view returns (uint[] memory) {
        return claimsByAddress[_user];
    }
       function getReinvestByUser(address _user) public view returns (uint[] memory) {
        return reinvestByAddress[_user];
    }
              function getReinvest(uint nftId) public view returns (Reinvest memory) {
        return reinvestByNFT[nftId];
    }

    ///funcion para cancelarlo onlyowner, se le devuelve al usuario deberia ser batch?
   function cancelExchange(uint nftId) onlyOwner() public returns (bool) {
        require(exchangeByNFT[nftId].status==Status.INPROCESS,"Not in proccess");
        require(ownerOf(nftId)==address(this),"Contract doesnt has NFT");
        _safeTransfer(address(this),exchangeByNFT[nftId].giver, nftId, "0x");
        exchangeByNFT[nftId].status=Status.CANCELED;
        exchangeByNFT[nftId].finished=block.timestamp;
        return true;
    }


    /// funcion para completarlo onlyownwer, se le envia al nuevo dueño 
    function endExchange(uint nftId,address _newOwnwer) onlyOwner() public returns (bool) {
        require(exchangeByNFT[nftId].status==Status.INPROCESS,"Not in proccess");
        require(ownerOf(nftId)==address(this),"Contract doesnt has NFT");
        _safeTransfer(address(this),_newOwnwer, nftId, "0x");
        exchangeByNFT[nftId].receiver=_newOwnwer;
        exchangeByNFT[nftId].status=Status.COMPLETED;
        exchangeByNFT[nftId].finished=block.timestamp;
        return true;
    }
        ///funcion para cancelarlo onlyowner, se le devuelve al usuario deberia ser batch?
   function cancelClaim(uint nftId) onlyOwner() public returns (bool) {
        require(claimsByNFT[nftId].status==Status.INPROCESS,"Not in proccess");
        require(ownerOf(nftId)==address(this),"Contract doesnt has NFT");
        _safeTransfer(address(this),claimsByNFT[nftId].claimer, nftId, "0x");
        claimsByNFT[nftId].status=Status.CANCELED;
        claimsByNFT[nftId].finished=block.timestamp;
        return true;
    }


    /// funcion para completarlo onlyownwer, se le envia al nuevo dueño 
    function endClaim(uint nftId) onlyOwner() public returns (bool) {
        require(claimsByNFT[nftId].status==Status.INPROCESS,"Not in proccess");
        require(ownerOf(nftId)==address(this),"Contract doesnt has NFT");
        _burn(nftId);
        exchangeByNFT[nftId].status=Status.COMPLETED;
        exchangeByNFT[nftId].finished=block.timestamp;
        return true;
    }

        ///funcion para cancelarlo onlyowner, se le devuelve al usuario deberia ser batch?
   function cancelReinvest(uint nftId) onlyOwner() public returns (bool) {
        require(reinvestByNFT[nftId].status==Status.INPROCESS,"Not in proccess");
        require(ownerOf(nftId)==address(this),"Contract doesnt has NFT");
        _safeTransfer(address(this),reinvestByNFT[nftId].reinvester, nftId, "0x");
        reinvestByNFT[nftId].status=Status.CANCELED;
        reinvestByNFT[nftId].finished=block.timestamp;
        return true;
    }


    /// funcion para completarlo onlyownwer, se le envia al nuevo dueño 
    function endReinvest(uint nftId,uint projectId,string memory tokenHash, string memory documentId) onlyOwner() public returns (bool) {
        require(reinvestByNFT[nftId].status==Status.INPROCESS,"Not in proccess");
        require(ownerOf(nftId)==address(this),"Contract doesnt has NFT");
        _burn(nftId);
        safeMint(reinvestByNFT[nftId].reinvester,tokenHash,documentId, projectId);
        reinvestByNFT[nftId].status=Status.COMPLETED;
        reinvestByNFT[nftId].finished=block.timestamp;
        return true;
    }
    function claim(uint nftId) public returns (bool) {
        require(ownerOf(nftId)==msg.sender,"Not  nft owner");
        require(claimsByNFT[nftId].status!=Status.CANCELED,"Canceled before");
        _safeTransfer(msg.sender,address(this), nftId, "0x");

        Claims memory c= Claims(msg.sender,nftId,block.timestamp,block.timestamp,Status.INPROCESS);
        claimsByNFT[nftId]=c;
        claimsByAddress[msg.sender].push(nftId);
        return true;

    }

     function reinvest(uint nftId) public returns (bool) {
        require(ownerOf(nftId)==msg.sender,"Not  nft owner");
        require(reinvestByNFT[nftId].status!=Status.CANCELED,"This reinvest was created before and canceled");
        _safeTransfer(msg.sender,address(this), nftId, "0x");

        Reinvest memory r= Reinvest(msg.sender,nftId,block.timestamp,block.timestamp,Status.INPROCESS);
        reinvestByNFT[nftId]=r;
        reinvestByAddress[msg.sender].push(nftId);
        return true;
    }
}


